import { Link } from "react-router-dom";
import { Toolbar, AppBar, Typography, CssBaseline } from "@material-ui/core";
import Pomodoro from "../assets/pomodoro.png";
import styled from "styled-components";

const StyledLink = styled(Link)`
  margin-left: 30px;
`;

function Navigation() {
  return (
    <div>
      <CssBaseline/>
      <AppBar style={{ backgroundColor: "grey" }} position="relative">
        <Toolbar>
          <img src={Pomodoro} width="30" />
          <Typography variant="h6" style={{'margin-left': 10,color: "red"}}>
            Tomato Pomodoro
          </Typography>
          <div >
          <StyledLink to="/">Home</StyledLink>
          <StyledLink to="/admin">Admin</StyledLink>
          <StyledLink to="/user">User</StyledLink>
          </div>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Navigation;
